import React, { Component,Suspense } from 'react';
import { connect } from 'react-redux';
import { renderRoutes } from 'react-router-config';
import { Search } from './Components/Search/Search';
import { Notification } from './Components/Notification/Notification';
import { Profile } from './Components/Profile/Profile';
import AppsIcon from '@material-ui/icons/Apps';
import MenuBookIcon from '@material-ui/icons/MenuBook';

export class HomePage extends Component {

    render() {

        return(
            <div className="main-wrapper loaded sidebar-folded" id="app" >
                <nav className="sidebar">
                    <div className="sidebar-header">
                        <a href="#" className="sidebar-brand">
                        Noble<span>UI</span>
                        </a>
                        <div className="">
                            <div style={{ color: '#031a61', fontSize: '20px', fontWeight: '900' }}>
                                QB
                            </div>
                        </div>
                    </div>
                    <div className="sidebar-body">
                        <ul className="nav">
                            <li className={this.props.location.pathname==="/"?"nav-item active":"nav-item"}>  
                                <a href="/" className="nav-link">
                                    <AppsIcon style={this.props.location.pathname!=="/"?{color: '#727cf5'}:{}}/>
                                    <span className="link-title">Dashboard</span>
                                </a>
                            </li>
                            <li style={{ marginTop: '20px' }} className={this.props.location.pathname==="/profile"?"nav-item active":"nav-item"}>  
                                <a href="/profile" className="nav-link">
                                <MenuBookIcon style={this.props.location.pathname!=="/profile"?{color: '#727cf5'}:{}}/>
                                <span className="link-title">Accounts</span>
                                </a>
                            </li>
                        </ul>
                    </div>
                </nav>
                <div className="page-wrapper">  
                    <nav class="navbar">
                        <div class="navbar-content">
                            <Search location={this.props}/>
                            <ul class="navbar-nav">
                                <Notification />
                                <Profile />
                            </ul>
                        </div>
                    </nav>
                    <div class="page-content">
                        <Suspense fallback={<div>Loading..</div>} >
                            {renderRoutes(this.props.route.routes)}
                        </Suspense>
                    </div>
                </div>
            </div>
        );
    }
}

const mapStateToProps = (state) => ({
    isAuthenticated: state.auth.isAuthenticated,
  });

export default connect(mapStateToProps)(HomePage);
